import React, { Component } from 'react';
import './App.css';
import {datos} from './datos.json' ;

class App extends Component {
  constructor(){
    super();
    this.state = {
      datos
    }
  }
  render() {
    return (
      <div className="App">
        <nav className="navbar navbar-dark bg-dark" id="navbar">
          <a href="/" className="text-white">
            Datos Ubicación
          </a>
        </nav>
        <table class="table">
          <thead>
            <tr>
              <th>ID</th>
              <th>Fecha</th>
              <th>Latitud</th>
              <th>Longitud</th>
            </tr>
          </thead>
          <tbody>
            <tr>
                <th><div id="ID">{this.state.datos}</div></th>

            </tr>
          </tbody> 
        </table>
      </div>
    );
  }
}

export default App;
